import {
  ADD_TODO,
  DELETE_TODO,
  EDIT_TODO,
  COMPLETE_TODO,
  IS_EDIT_TODO,
  FETCH_ALL_TODOS,
} from './types';


export default function todoAppReducer(state = [], action) {
  switch (action.type) {
    case FETCH_ALL_TODOS:
      console.log(action.payload.todos);
      return [...state, action.payload.todos];

    default:
      return state;
  }
}
